def circular_shift(x: int, shift: int) -> str:
    digits = list(str(x))
    num_digits = len(digits)
    if shift > num_digits:
        return ''.join(reversed(digits))
    shift = shift % num_digits
    return ''.join(digits[-shift:] + digits[:-shift])

