def numerical_letter_grade(grades: List[float]) -> List[str]:
    grades_map = [(4.0, 'A+'), (3.7, 'A'), (3.3, 'A-'), (3.0, 'B+'), (2.7, 'B'), (2.3, 'B-'), (2.0, 'C+'), (1.7, 'C'), (1.3, 'C-'), (1.0, 'D+'), (0.7, 'D'), (0.0, 'D-')]
    result = []
    for gpa in grades:
        for threshold, grade in grades_map:
            if gpa >= threshold:
                result.append(grade)
                break
    return result

