def count_nums(arr: List[int]) -> int:

    def sum_of_digits(num: int) -> int:
        total = 0
        is_negative = num < 0
        num = abs(num)
        while num > 0:
            total += num % 10
            num //= 10
        return -total if is_negative else total
    count = 0
    for num in arr:
        if sum_of_digits(num) > 0:
            count += 1
    return count

