            return False
        i = 5
        while i * i <= n:
            if n % i == 0 or n % (i + 2) == 0:
                return False
            i += 6
        return True
    start_max = max(interval1[0], interval2[0])
    end_min = min(interval1[1], interval2[1])
    intersection_length = end_min - start_max + 1
    if intersection_length > 0 and is_prime(intersection_length):
        return 'YES'
    return 'NO'

