    if not arr:
        return None
    prod_sign = 1
    sum_magnitude = 0
    for num in arr:
        sum_magnitude += abs(num)
        if num == 0:
            prod_sign = 0
            break
        elif num < 0:
            prod_sign *= -1
    return sum_magnitude * prod_sign

