def poohbear(s: str) -> str:
    import math
    from collections import defaultdict
    memory = defaultdict(int)
    pointer = 0
    copied_value = 0
    output = []
    i = 0
    stack = []
    while i < len(s):
        c = s[i]
        if c == '+':
            memory[pointer] = (memory[pointer] + 1) % 256
        elif c == '-':
            memory[pointer] = (memory[pointer] - 1) % 256
        elif c == '>':
            pointer += 1
        elif c == '<':
            pointer -= 1
        elif c == 'c':
            copied_value = memory[pointer]
        elif c == 'p':
            memory[pointer] = copied_value
        elif c == 'W':
            if memory[pointer] == 0:
                while i < len(s) and s[i] != 'E':
                    i += 1
            else:
                stack.append(i)
        elif c == 'E':
            if memory[pointer] != 0:
                i = stack.pop() - 1
            else:
                stack.pop()
        elif c == 'P':
            output.append(chr(memory[pointer]))
        elif c == 'N':
            output.append(str(memory[pointer]))
        elif c == 'T':
            memory[pointer] = 2 * memory[pointer] % 256
        elif c == 'Q':
            memory[pointer] = memory[pointer] ** 2 % 256
        elif c == 'U':
            memory[pointer] = int(math.sqrt(memory[pointer]))
        elif c == 'L':
            memory[pointer] = (memory[pointer] + 2) % 256
